import Footer from './Components/Footer';
import Header from './Components/Header';
import './style.scss';

function App() {
  return (
    <div className="App">
      <header>
        <Header />
      </header>

      <footer>
        <Footer />
      </footer>
    </div>
  );
}

export default App;
